const Precio = (props) => {
    const {price, percent_change_1h, percent_change_7d, percent_change_24h} = props.precio;
    return (  
        <div className="card text-white bg-success mb-3">
            <div className="card-header">Precio del Bitcoin</div>
            <div className="card-body">
                    <h4 className="card-title">Precio Actual: $ {price} </h4>
                    <div className="d-md-flex">
                        <p className="card-text"><span className="font-weight-bold">Última Hora:</span></p>
                        <p className="card-text"><span className="font-weight-bold">Últimas 21 horas:</span></p>
                        <p className="card-text"><span className="font-weight-bold">Últimos 7 Días:</span></p>
                    </div>
            </div>
        </div>

    );
}
 
export default Precio;
